import React from 'react';
import { SafeAreView, StyleSheet, Text, View } from 'react-native';

export default function App() {
  return (
    <SafeAreView>
    <View style={styles.container}>
      <Text>Testing</Text>
    </View>
    </SafeAreView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
